INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 3001100, 2.1, 100, "ヤマト", 2, -416.5, 130011, "2024/10/31 12:00:00", 0.0, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2030/01/01 14:59:59", 3001);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (4, 3001101, 5.68, 101, "ヤマト", 2, -416.5, 130011, "2024/10/31 12:00:00", 0.0, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "2030/01/01 14:59:59", 3001);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 3001102, 0.0, 102, "ヤマト", 1, -416.5, 130011, "2024/10/31 12:00:00", 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "2030/01/01 14:59:59", 3001);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 3002100, 0.0, 100, "フブキ", 1, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 3002101, 0.0, 101, "フブキ", 1, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (5, 3002102, 8.53, 102, "フブキ", 2, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (7, 3002103, 5.67, 103, "フブキ", 1, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 3002104, 0.0, 104, "フブキ", 1, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (3, 3002300, 0.0, 300, "フブキ", 3, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "2030/01/01 14:59:59", 3004);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (7, 3002400, 0.0, 301, "フブキ", 7, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "2030/01/01 14:59:59", 3005);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (2, 3003200, 4.4, 200, "フブキ", 1, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "2030/01/01 14:59:59", 3003);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (7, 3003201, 0.0, 201, "フブキ", 7, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "2030/01/01 14:59:59", 3003);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 3003202, 5.6, 202, "フブキ", 2, -416.5, 130211, "2024/10/31 12:00:00", 0.0, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "2030/01/01 14:59:59", 3003);
